import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// import Image from 'react-bootstrap/Image';
import headshot from '../../images/jeff-berlin-landing-background-min.jpg';

function Landing() {
  return (
    <Container fluid className='landing' style={{ marginTop: '64px', backgroundImage: `url(${headshot})`, backgroundSize: 'cover'}}>
      <Row>
        <Col>
          Jeff Berlin
          UI/UX Developer & Designer
        </Col>
      </Row>
    </Container>
  );
}

export default Landing;
